Iz("common/stringbuffer.effekt",'module stringbuffer\n\nimport bytearray\n\ninterface StringBuffer {\n  def write(str: String): Unit\n  def flush(): String\n}\n\ndef stringBuffer[A] { prog: \x3d\x3e A / StringBuffer }: A \x3d {\n  val initialCapacity \x3d 128\n  var buffer \x3d bytearray::allocate(initialCapacity)\n  // next free index to write to\n  var pos \x3d 0\n\n  def ensureCapacity(sizeToAdd: Int): Unit \x3d {\n    val cap \x3d buffer.size - pos\n    if (sizeToAdd \x3c\x3d cap) ()\n    else {\n      // Double the capacity while ensuring the required capacity\n      val newSize \x3d max(buffer.size * 2, buffer.size + sizeToAdd)\n      buffer \x3d buffer.resize(newSize)\n    }\n  }\n\n  try { prog() }\n  with StringBuffer {\n    def write(str) \x3d {\n      val bytes \x3d fromString(str)\n      ensureCapacity(bytes.size)\n      bytes.foreach { b \x3d\x3e\n        buffer.unsafeSet(pos, b)\n        pos \x3d pos + 1\n      }\n      resume(())\n    }\n    def flush() \x3d {\n      // resize (\x26 copy) buffer to strip trailing zeros that otherwise would be converted into 0x00 characters\n      val str \x3d bytearray::resize(buffer, pos).toString()\n      // NOTE: Keep the `buffer` as-is (no wipe, no realloc),\n      //       just reset the `pos` in case we want to use it again.\n      pos \x3d 0\n      resume(str)\n    }\n  }\n}\n\n/// Handler for string interpolation using a string buffer\ndef s { prog: () \x3d\x3e Unit / { literal, splice[String] } }: String \x3d\n  stringBuffer {\n    try { prog(); do flush() }\n    with splice[String] { x \x3d\x3e resume(do write(x)) }\n    with literal { s \x3d\x3e resume(do write(s)) }\n  }\n\nnamespace examples {\n  def main() \x3d {\n    with stringBuffer\n\n    do write("hello")\n    do write(", world")\n    // prints `hello, world`\n    println(do flush())\n\n    // prints the empty string\n    println(do flush())\n\n    do write("Ef")\n    do write("fe")\n    do write("kt")\n    do write(" \x3d ")\n    do write("")\n    do write("Effekt")\n    // prints `Effekt \x3d Effekt`\n    println(do flush())\n  }\n}\n');
